_foot\">\n        <a href=\"\/\/weibo.com\/a\/hot\/realtime\" class=\"S_txt1\" target=\"_blank\">查看更多<i class=\"W_ficon ficon_arrow_right S_ficon\">a<\/i><\/a>\n    <\/div>\n<\/div>\n"})</script>
